    static class Die {
        int[] t;
        int[] op;
        int n;

        public Die(int[] t, int[] op, int n) {
            this.t = t;
            this.op = op;
            this.n = n;
        }
    }

    static class State implements Comparable<State> {
        int[] op;
        int p;

        public State(int[] op, int p) {
            this.op = op;
            this.p = p;
        }

        @Override
        public int compareTo(State o) {
            for (int i = 0; i < Math.min(op.length, o.op.length); i++) {
                if (op[i] != o.op[i]) {
                    return op[i] - o.op[i];
                }
            }
            return Integer.compare(op.length, o.op.length);
        }
    }

    public static void main(String[] args) throws IOException {
